  <script>
    const modelViewer = document.getElementById('viewer');

    const bgColorPicker = document.getElementById('background-color-picker');
    const colorPicker = document.getElementById('material-color-picker');
    const roughnessSlider = document.getElementById('roughness-slider');
    const metalnessSlider = document.getElementById('metalness-slider');
    const roughnessValue = document.getElementById('roughness-value');
    const metalnessValue = document.getElementById('metalness-value');
    const colorValue = document.getElementById('color-value');

    const applyMaterialProperties = () => {
      if (!modelViewer.model) return;

      const colorHex = colorPicker.value;
      const roughness = parseFloat(roughnessSlider.value);
      const metalness = parseFloat(metalnessSlider.value);
      
      roughnessValue.textContent = roughness.toFixed(2);
      metalnessValue.textContent = metalness.toFixed(2);
      colorValue.textContent = colorHex.toUpperCase();

      const colorRgb = [
        parseInt(colorHex.substring(1, 3), 16) / 255,
        parseInt(colorHex.substring(3, 5), 16) / 255,
        parseInt(colorHex.substring(5, 7), 16) / 255
      ];
      
      modelViewer.model.materials.forEach(material => {
        if (material.pbrMetallicRoughness) {
            material.pbrMetallicRoughness.setBaseColorFactor([...colorRgb, 1]);
            material.pbrMetallicRoughness.setRoughnessFactor(roughness);
            material.pbrMetallicRoughness.setMetallicFactor(metalness);
        }
      });
    };
    
    modelViewer.addEventListener('load', () => {
      modelViewer.style.backgroundColor = bgColorPicker.value;
      applyMaterialProperties();

      bgColorPicker.addEventListener('input', () => {
        modelViewer.style.backgroundColor = bgColorPicker.value;
      });
      colorPicker.addEventListener('input', applyMaterialProperties);
      roughnessSlider.addEventListener('input', applyMaterialProperties);
      metalnessSlider.addEventListener('input', applyMaterialProperties);
      
      
      
      
      const partInfo = {"manufacturer":"TAILIFT","partNumber":"33782","partName":"U","lifespan":"6","installDate":"2023/10/3"};
      const refDatePicker = document.getElementById('reference-date-picker');

      function getStatusCssClass(status) {
        switch (status) {
            case '': return 'expired';
            case '': return 'warning';
            default: return 'normal';
        }
      }

      function calculateLifecycle(part, referenceDate) {
        const { partName, partNumber, installDate, lifespan } = part;
        const install = new Date(installDate);
        let totalLifespanDays = 0;
        
        const yearMatch = lifespan.match(/(\d+)\s*/);
        const hourMatch = lifespan.match(/(\d+)\s*/);

        if (yearMatch && yearMatch[1]) {
            totalLifespanDays = parseFloat(yearMatch[1]) * 365.25;
        } else if (hourMatch && hourMatch[1]) {
            totalLifespanDays = parseFloat(hourMatch[1]) / 8;
        }

        const daysUsed = Math.floor((referenceDate.getTime() - install.getTime()) / (1000 * 60 * 60 * 24));
        const daysRemaining = Math.floor(totalLifespanDays - daysUsed);
        
        const recommendedChangeDate = new Date(install);
        recommendedChangeDate.setDate(recommendedChangeDate.getDate() + Math.round(totalLifespanDays));
        
        const percentageUsed = totalLifespanDays > 0 ? Math.min(100, (daysUsed / totalLifespanDays) * 100) : 100;

        let status = '';
        if (daysRemaining < 0) {
            status = '';
        } else if (daysRemaining <= 182) {
            status = '';
        }

        return {
            partName,
            modelNumber: partNumber,
            installDate,
            lifespan,
            recommendedChangeDate: recommendedChangeDate.toISOString().split('T')[0].replace(/-/g, '/'),
            status,
            daysUsed: Math.max(0, daysUsed),
            daysRemaining: daysRemaining,
            totalLifespanDays: Math.round(totalLifespanDays),
            percentageUsed: Math.max(0, percentageUsed),
        };
      }
      
      function updateLifecycleUI(referenceDate) {
        const data = calculateLifecycle(partInfo, referenceDate);
        const statusClass = getStatusCssClass(data.status);
        
        document.getElementById('lc-part-name').textContent = data.partName;
        document.getElementById('lc-model-number').textContent = data.modelNumber;
        document.getElementById('lc-install-date').textContent = data.installDate;
        document.getElementById('lc-lifespan').textContent = data.lifespan;
        document.getElementById('lc-change-date').textContent = data.recommendedChangeDate;
        
        const statusEl = document.getElementById('lc-status');
        statusEl.textContent = data.status;
        statusEl.className = 'status-' + statusClass;
        
        document.getElementById('lc-days-used-label').textContent = ': ' + data.daysUsed + ' ';
        document.getElementById('lc-percentage-label').textContent = data.percentageUsed.toFixed(1) + '%';
        document.getElementById('lc-days-remaining-label').textContent = ': ' + data.daysRemaining + ' ';

        const progressFillEl = document.getElementById('lc-progress-fill');
        progressFillEl.style.width = data.percentageUsed + '%';
        progressFillEl.className = 'progress-bar-fill status-bg-' + statusClass;
      }

      function initLifecycle() {
        const today = new Date();
        const todayString = today.toISOString().split('T')[0];
        refDatePicker.value = todayString;
        updateLifecycleUI(today);

        refDatePicker.addEventListener('input', (e) => {
            if (e.target.value) {
                // Use T00:00:00 to ensure date is parsed in local timezone
                const newRefDate = new Date(e.target.value + 'T00:00:00');
                updateLifecycleUI(newRefDate);
            }
        });
      }

      initLifecycle();
      document.getElementById("order-btn").addEventListener("click", () => {
        window.location.href = `../../OrderSystem/order_system.html?part_code=${encodeURIComponent(partInfo["partNumber"])}`;
      });
  
    });
  </script>
</body>
</html>
